import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for profile elements and click on profile link
    await page.waitForSelector('a[href="#"]:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a[href="#"]:has-text("Your Profile")');

    // Wait for profile content to load
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot after navigating to profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return null;

      return {
        fullName: profileHeader.querySelector('.profile-info h2')?.textContent?.trim() || 'Not found',
        username: profileHeader.querySelector('.username')?.textContent?.trim() || 'Not found',
        bio: profileHeader.querySelector('.bio')?.textContent?.trim() || 'Not found',
        orders: profileHeader.querySelector('.stat:first-child .stat-number')?.textContent?.trim() || 'Not found',
        reviews: profileHeader.querySelector('.stat:nth-child(2) .stat-number')?.textContent?.trim() || 'Not found',
        rating: profileHeader.querySelector('.stat:last-child .stat-number')?.textContent?.trim() || 'Not found'
      };
    });

    // Take final screenshot with profile data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Successfully harvested user profile information",
      extractedData: profileData || {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
